import React from 'react';
import ServiceCard from './ServiceCard';
import Data from './Data';

const Service = () => {
    return (
        <div className='container'>
            <div className="row">
            <div className="col-md-3"></div>
                {Data.map((service) => (
                    <ServiceCard key={service.id} service={service} />
                ))}
            </div>
        </div>
    );
};

export default Service;
